}

export namespace EncryptionKey {
  export function isa(o: any): o is EncryptionKey {
    return __isa(o, "EncryptionKey");
  }
}

export enum EncryptionKeyType {
  KMS = "KMS"
}

export interface GetTerminologyRequest {
  __type?: "GetTerminologyRequest";
